import { Fragment } from 'react';
import { Doughnut} from 'react-chartjs-2'

function StoredPageDougnut({sumObject, height, width}) {
    const macroNames = Object.keys(sumObject);
    const macroValues = Object.values(sumObject);

    // console.log(macroValues);
    
    return <Doughnut
        data={{
          labels: [macroNames[1],macroNames[2],macroNames[3],macroNames[4]],
          datasets: [
            {
            //   label: sumObject.name,
              data: [(macroValues[1]).toFixed(1), (macroValues[2]).toFixed(1), (macroValues[3]).toFixed(1), (macroValues[4]).toFixed(1)],
              backgroundColor: [
                'rgba(255, 99, 132, 1)',
                'rgba(54, 162, 235, 1)',
                'rgba(255, 206, 86, 1)',
                'rgba(75, 192, 192, 1)',
                'rgba(153, 102, 255, 1)',
                'rgba(255, 159, 64, 1)',
                ],
                borderWidth: 1,
              },
            ],
          }}
          height={height}
          width={width}
          options={{
            maintainAspectRatio: false,
            // responsive: true,
            // title: {
            //   display:true,
            // //   text: [sumObject.name], 
            //   fontSize: 20,
            //   fontFamily: 'Arial',
            //   fontColor: "#7C7C7C", 
            //   padding: 10
            // }
          }}
          />
        {/* <div className="store-macro">F: {macroValues[1].toFixed(2)} g</div>
        <div className="store-macro">C: {macroValues[2].toFixed(2)} g</div>
        <div className="store-macro">Fi: {macroValues[3].toFixed(2)} g</div>
        <div className="store-macro">P: {macroValues[4].toFixed(2)} g</div> */}
        // </Fragment>
}
export default StoredPageDougnut;
